Before we get into how to use ressa , It is a good idea to briefly touch on the scope of a parser or syntax analyzer . The biggest thing to understand is that we still are not dealing with the semantic meaning of the program. That means we won't be able to discover things like assigning to undeclared variables or attempting to call undefined functions because we need to have access to a larger context definition. To that end, ressa 's true value isn't realized until it is embedded into another program that provide this information. With that said ressa is providing that same larger contenxt for what is provided by ress . It achieves that by wrapping the Scanner in a struct called Parser . Essentially Parser provides a way to keep track of what any given set of Token s might mean. Parser also implements Iterator over the enum ProgramPart , which has 3 cases representing the 3 different top level JavaScript constructs. Decl - a variable/function/class declaration Variable - A top level variable declaration e.g. let x = 0; Class - A named class definition at the top level Function - A named function definition at the top level Import - An ES Module import statement Export - An ES Module export statement Directive - pretty much just 'use strict' Statement - A catch all for everything else Block - A collection of statements wrapped in curly braces Break - A break statement will exit a loop or labeled statement early Continue - A continue statement will short circuit a loop Debugger - The literal ident debugger DoWhile - A do loop which executes the body before testing whether to continue Empty - A single semicolon Expr - A catch-all for everything else For - A c-style for loop e.g. `for ForIn - A for loop that assigns the key of an enumerable at the top of each iteration ForOf - A for loop that assigns the value of an iterable at the top of each iteration If - A set of if/else if/else statements Labeled - A statement that has been named by an attached identifier Return - The return statement that resolves a function's value Switch - A test Expression a collection of CaseStatements Throw - A statement that results in an error being thrown Try - A try/catch/finally block Var - A non-top level variable declaration While - A loop which continues based on a test Expresssion With - An antiquated statement that changes the order of identifier resolution Statement being the real work-horse of the group, while a top level function definition would be a Decl , a non-top level function definition would be a Statement . Both Decl and Statement themselves are enums representing the different possible variations. Looking further into the Statement variants, you may notice there is another catch-all in the Expr variant. A sub class of Statement is the Expression enum which defines an even more granular set of program parts. Expression Assignment - A single assignment in a variable declaration, this is required because a variable declaration can have multiple assignments Array - An array literal ArrowFunction - An arrow function expression Await - Any expression preceded by the await keyword Call - Calling a function or method Class - A class expression is a class definition with an optional identifier that is assigned to a variable Conditional - Also known as the "ternary" operator e.g. let x = test ? consequent : alternate Function - A function expression is a function definition with an optional identifier that is either self executing, assigned to a variable or a Call argument Ident - The identifier of a variable, class, import, export or function Literal - A "primitive" literal Logical - Two expressions separated by && or || Member - Accessing a sub property on something. e.g. [0,1,2][1] or console.log MetaProperty - Currently the only MetaProperty is in a function body you can check new.target to see if something was called with the new keyword New - A Call expression preceded by the new keyword Object - An object literal Sequence - Any sequence of expressions separated by commas Spread - the ... operator followed by an expression SuperExpression - The super pseudo-keyword TaggedTemplate - An identifier followed by a template literal ThisExpression - The this pseudo-keyword Unary - An operation (that is not an update) that requires on expression as an argument Update - An operation that uses the ++ or -- operator Yield - the yield contextual keyword followed by an optional expression for use in generator function Most of the Expression , Statement , and Decl variants have associated values, to see more information about them I encourage you to check out the documentation . There should be an example and description provided for each of the possible combinations. With that long winded explanation of the basic structure we are working with let's take a look at how we would use the Parser and ProgramPart . use ressa::*; static JS: &str = "
function Thing(stuff) { this.stuff = stuff;
}
class Stuff { constructor(thing) { this.thing = thing; }
}
"; fn main() { let parser = Parser::new(JS).expect("Failed to create parser"); for part in parser { let part = part.expect("Failed to parse part"); println!("{:?}", part); }
} If we were to run the above we would get the following output. Script([ Decl( Function( Function { id: Some( "Thing" ), params: [ Pattern( Identifier( "stuff" ) ) ], body: [ Statement( Expr( Assignment( AssignmentExpression { operator: Equal, left: Expr( Member( MemberExpression { object: ThisExpression, property: Ident( "stuff" ), computed: false } ) ), right: Ident( "stuff" ) } ) ) ) ], generator: false, is_async: false } ) )
]) If we walk through the output, we start by seeing that the This program consists of a single part which is a ProgramPart::Decl Inside of that is a Declaration::Function Inside of that is a Function Has an id of an optional Identifier with the value of Some("Thing") It has a one item vec of Pattern s in params Which is a Pattern::Identifier Inside of that is an Identifier with the value of "stuff" It has a body that is a one item vec of ProgramPart s The item is a ProgramPart::Statement Which is a Statement::Expr Inside of that is an Expression::Assignment Inside of that is an AssignmentExpression Which has an operator of Equal The left hand side is an Expression::Member The object being Expression::This The property of Expression::Ident with the value of "stuff" The right hand side is an Expression::Ident with the value of "stuff" computed is false It is not a generator It is not is_async Phew! That is quite a lot of information! A big part of why we need to be that verbose is because of the "you can do anything" nature of JavaScript. Let's use the MemberExpression and an example, below are a collection of ways to write a MemberExpression in JavaScript. console.log;
console['log'];
const logVar = 'log';
console[logVar];
console[['l','o','g'].join('')];
class Log { toString() { return 'log'; }
}
const logToString = new Log();
console[logToString];
function logFunc() { return 'log';
}
console[logFunc()];
function getConsole() { return console
}
getConsole()[logFunc()];
getConsole().log; And I am sure that this isn't an exhaustive list of ways to construct a MemberExpression . With the level of information provided we have enough to truly understand the syntactic meaning of the text. This will enable us to build more powerful tools to analyze and/or manipulate the any given JavaScript program. With the pervasivness of print debugging , wouldn't it be nice if we had a tool that would automatically insert a console.log at the top of every function and method in a program that would print the name of that function and also each of the arguments? Let's take a look at what that might look like.

